import "./collectionPreview.styles.scss";

const CollectionPreview = ({ title, items }) => {
  return (
    <div className="collection-preview">
      <div className="title">
        <h1>{items.title}</h1>
        <div className="preview"></div>
      </div>
    </div>
  );
};

export default CollectionPreview;
